parameters.text:
=Analyze the following jobs and return a decision for each job.

For each job, output a JSON object with the fields:
"keyword ofsearch", "Job Title", "Budget", "Posted On", "Job URL", "Description", "Tags", "Decision", "Reason", "Accepted".

Rules:
- Jobs older than 18 hours from the current time ({now}) should be refused with:
    Decision = "Refused", Reason = "job older than 18 hours", Accepted = false.
- Before processing a job, check in the Google Sheet using the tool "Get row(s) in sheet in Google Sheets":
    - Search column: "Job URL"
    - Search value: the job's URL
    - If a match is found, **ignore the job** and do not include it in the output.
- Process all jobs sequentially until every job has a decision or is ignored.

Input:
- related search and Job data and Job posted on and
and publishTime and current_time: 
{{ $json.title }}
{{ $json.link }}
{{ JSON.stringify($json.data) }}

{{
(() => {
  const now = new Date();
  const year = now.getFullYear();
  const month = String(now.getMonth() + 1).padStart(2, '0');
  const day = String(now.getDate()).padStart(2, '0');
  const hours = String(now.getHours()).padStart(2, '0');
  const minutes = String(now.getMinutes()).padStart(2, '0');

  return `${year}-${month}-${day} ${hours}:${minutes}`;
})()
}}

- Job URL template: https://www.upwork.com/jobs/<ciphertext>

Output:
- JSON array of job objects with the decision and boolean Accepted field included.
- Exclude jobs already existing in the Google Sheet.
- Leave missing fields empty.
-each job must have his url by https://www.upwork.com/jobs/<ciphertext>
